package eg2;

public class Cali {
	public Cali(int x,int y) {
		System.out.println(x+y);
	}
	public Cali(int x,int y,int z) {
		System.out.println(x+y+z);
	}
	

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		Cali obj1 = new Cali(7,9);
		Cali obj2 = new Cali(11,22,33);

	}

}
